import React from 'react'
import { useDispatch, useSelector } from "react-redux";
import { handleInput } from '../redux/ToFahrenheitConverter';

function ToFahrenheit() {
    const { tempt } = useSelector((state) => state.counter);
    const dispatch = useDispatch();
    return (
        <div>
            <h1>Current Number : {tempt}</h1>
            <button onClick={() => dispatch(handleInput(25))}>Tambah</button>
            <br />
            <br />
            {/* <button onClick={() => dispatch(decrement())}>Kurang</button> */}
        </div>
    )
}

export default ToFahrenheit
